import Home from "./components/Pages/Home";
import Partners from "./components/Pages/Partners";
import VestiCard from "./components/Pages/VestiCard";
import Settings from "./components/Pages/Settings";


const menu = [
    {title: 'Accueil', route: '/home', component: Home, public: true},
    {title: 'Partenaires', route: '/partners', component: Partners, public: true},
    {title: 'Mon 31', route: '/vesticard', component: VestiCard, public: false},
    {title: 'Paramètres', route: '/settings', component: Settings, public: false},
];

export const api_link = 'http://127.0.0.1:3000';
export const api_key = 'e1dbd1d455139bb0d728a5db2ab27996';

export default menu;
